func TestPackInitParam(t *testing.T) {
	abi, err := eth2client.Eth2ClientMetaData.GetAbi()
	if err != nil {
		t.Fatal(err)
	}
	pack, err := abi.Pack("init", common.Hex2Bytes(INIT_PARAM))
	if err != nil {
		t.Fatal(err)
	}
	t.Log(common.Bytes2Hex(pack))
}

