func TestPackHeaders(t *testing.T) {
	headers := []string{
		"",
		"",
		"",
		"",
		"",
	}
	var batchHeaders []byte
	for _, v := range headers {
		var out ethashapp.Output
		out.HeaderRLP = string(common.Hex2Bytes(v))
		outBytes, err := rlp.EncodeToBytes(out)
		if err != nil {
			logger.Error("rlp encode error: ", err)
		}
		batchHeaders = append(batchHeaders, outBytes...)
	}
	abi, err := eth2client.Eth2ClientMetaData.GetAbi()
	if err != nil {
		t.Fatal(err)
	}
	pack, err := abi.Pack("submit_execution_header", batchHeaders)
	if err != nil {
		t.Fatal(err)
	}
	t.Log(common.Bytes2Hex(pack))
}
